<div class="entities" style="line-height: 2.5; direction: ltr">Salmon DB00644 and its analogues bind the human placental receptor . OBJECTIVE : The presence of DB00644 receptors in the human placenta has been recognized for a number of years . However , mammalian DB00644 , which is expressed in placental tissues , has limited affinity for the chorionic receptor . On the basis of immunological and bioactivity data , we have previously proposed that the chorionic DB00644 may differ from mammalian DB00644 . METHODS : We have studied the affinity of another isoform of DB00644 ( ie , salmon DB00644 and stable analogues of this DB00644 isoform ) , and compared their receptor affinity to that of mammalian DB00644 and its analogues . RESULTS : Using our receptor assay method with the labeled mammalian DB00644 analogue 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06719
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , salmon DB00644 had a twofold greater affinity for the placental 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P30968
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 than did mammalian DB00644 and for the stable salmon DB00644 analogue the affinity was increased tenfold . Using a homologous receptor assay method with a stable salmon DB00644 analogue as label , the affinity for this salmon DB00644 analogue had a K ( d ) of 101 nmol / L . CONCLUSION : The presence of these higher affinity receptors for non-mammalian DB00644 in the human placenta has led us to propose that the chorionic tissues may express more than one isoform of DB00644 and that non-mammalian DB00644 , such as salmon DB00644 , may be potent regulators of placental functions .</div>

<h2 style="margin: 0">1</h2>

</mark>
 activates heat shock protein expression and cardioprotection in neonatal rat cardiomyocytes . Heat shock proteins ( HSPs ) constitute an endogenous cellular defense mechanism against environmental stresses . In the past few years , studies have shown that overexpression of HSPs can protect cardiac myocytes against ischemia-reperfusion injury . In an attempt to increase the HSPs in cardiac tissue , we used the compound radicicol that activates HSP expression by binding to the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 kDa ( HSP 90 ) . HSP 90 is the main component of the cytosolic molecular chaperone complex , which has been implicated in the regulation of the heat shock factor 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q00613

</mark>
 ) . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q00613
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 is responsible for the transcriptional activation of the heat shock genes . In the present study , we show that radicicol induces HSP expression in neonatal rat cardiomyocytes , and this increase in HSPs confers cardioprotection to these cardiomyocytes . We also show that radicicol induction of the HSP and cardioprotection is dependent on the inhibition of HSP 90 in cardiomyocytes . These results indicate that modulation of the active HSP 90 protein level plays an important role in cardioprotection . Therefore , compounds , such as radicicol and its possible derivatives that inhibit the function of HSP 90 in the cell may represent potentially useful cardioprotective agents .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Proteomic identification of radiation response markers in mouse intestine and brain . Increasing efforts are being made to develop more sensitive and faster molecular methodologies at the genomic and proteomic levels for the identification of protein markers after exposure to ionizing radiation ( IR ) . However , few specific protein markers , especially organ-specific markers , have been identified . In this study , we analyzed altered protein expressions in various tissues , namely , brain , lung , spleen , and intestine , from 1 Gy-irradiated mice by employing 2 - DE analysis . MALDI-TOF MS and peptide mapping identified 25 proteins that showed greater than twofold expressional changes . In order to confirm significant differences between control and IR-treated samples , ten identified proteins with available commercial antibodies were selected for immunoblotting . Of these , only five showed protein expression patterns that were similar to 2 - DE data . These were heat shock protein 5 ( HSP 5 ) , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 kDa β , HSP 1 , transaldolase 1 ( Q96RJ0 ) , and phosphoglycerate kinase 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00558

</mark>
 ) . In particular , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 was specifically upregulated in mouse intestine , and Q96RJ0 was specifically downregulated in brain by irradiation . Q96RJ0 expression was unaltered in other tissues . Based on these data , we suggest that Q96RJ0 and

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Effects of external calcium on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . DB01373 is a known signalling molecule in eukaryotic cells and plays a central role in the regulation of many cellular processes . In the following study , we report on the effect of external calcium treatments on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . We observed that the intracellular calcium content of P . bainier 229-7 mycelia was increased in response to exposure to high external Ca ( 2 + ) concentrations . Both ginsenoside Rd biotransformation and β-glucosidase activity were both found to be dependent on the external calcium concentration . At an optimal Ca ( 2 + ) concentration of 45 mM , maximal ginsenoside Rd bioconversion rate of 92.44 % was observed and maximal β-glucosidase activity of 0.1778 U was reached in a 72 - h biotransformation . The Ca ( 2 + ) channel blocker Verapamil blocked the trans-membrane influx of calcium and decreased ginsenoside Rd biotransformatiom . In addition , β-glucosidase activity and ginsenoside Rd content decreased by 36.0 and 29.2 % respectively after a 72 - h incubation in the presence of 0.05 mM P62158 ( P62158 ) antagonist 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00850
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 . These results suggest that both Ca ( 2 + ) channels and P62158 are involved in ginsenoside Rd biotransformation via regulation of β-glucosidase activity . This is the first report regarding the effects of calcium signal transduction on biotransformation and enzyme activity in fungi .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Alterations in molecular chaperones and eIF 2alpha during lung endothelial cell apoptosis . We have previously demonstrated that inhibition of CAAX carboxyl methylation with AGGC caused redistribution and condensation of the ER molecular chaperones , glucose-regulated protein ( GRP ) - 94 and calnexin ; an effect that was attenuated by overexpression of dominant active RhoA . We have also shown that AGGC decreased

 or ultraviolet ( UV ) irradiation . These results suggest that posttranslational processing of CAAX proteins is important in maintaining localization of molecular chaperones normally found in the ER . We also noted that AGGC , but not simvastatin ,

<h2 style="margin: 0">15</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Augmentation of methamphetamine-induced behaviors in transgenic mice lacking the trace amine-associated receptor 1 . The trace amine-associated receptor 1 ( Q96RJ0 ) is a G protein-coupled receptor that is functionally activated by amphetamine-based psychostimulants , including amphetamine , methamphetamine and DB01454 . Previous studies have shown that in transgenic mice lacking the Q96RJ0 gene ( Q96RJ0 knockout ; KO ) a single injection of amphetamine can produce enhanced behavioral responses compared to responses evoked in wild-type ( WT ) mice . Further , the psychostimulant effects of cocaine can be diminished by selective activation of Q96RJ0 . These findings suggest that Q96RJ0 might be implicated in the rewarding properties of psychostimulants . To investigate the role of Q96RJ0 in the rewarding effects of drugs of abuse , the psychomotor stimulating effects of amphetamine and methamphetamine and the conditioned rewarding effects of methamphetamine and morphine were compared between WT and Q96RJ0 KO mice . In locomotor activity studies , both single and repeated exposure to 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01576
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 or methamphetamine generated significantly higher levels of total distance traveled in Q96RJ0 KO mice compared to WT mice . In conditioned place preference ( CPP ) studies , Q96RJ0 KO mice acquired methamphetamine-induced CPP earlier than WT mice and retained CPP longer during extinction training . In morphine-induced CPP , both WT and KO genotypes displayed similar levels of CPP . Results from locomotor activity studies suggest that Q96RJ0 may have a modulatory role in the behavioral sensitization to amphetamine-based psychostimulants . That methamphetamine-but not morphine-induced CPP was augmented in Q96RJ0 KO mice suggests a selective role of Q96RJ0 in the conditioned reinforcing effects of methamphetamine . Collectively , these findings provide support for a regulatory role of Q96RJ0 in methamphetamine signaling .</div>

<h2 style="margin: 0">26</h2>

 mitigates CGRP 1 - associated motor neuron degeneration caused by an expanded polyglutamine repeat tract . Spinal and bulbar muscular atrophy ( SBMA ) is a motor neuron disease caused by the expansion of the CAG triplet repeat within the androgen receptor ( AR ) gene . Here , we demonstrated that pathogenic AR upregulates the gene encoding calcitonin gene-related peptide α ( CGRP 1 ) . In neuronal cells , overexpression of CGRP 1 induced cellular damage via the activation of the c-Jun N-terminal kinase ( JNK ) pathway , whereas pharmacological suppression of CGRP 1 or JNK attenuated the neurotoxic effects of pathogenic AR . The depletion of CGRP 1 inactivated JNK and suppressed neurodegeneration in a mouse model of SBMA .

<div class="entities" style="line-height: 2.5; direction: ltr">Novel P0C6A0 mimetics developed to treat type 2 diabetes promote progenitor cell proliferation in the brain . One of the symptoms of diabetes is the progressive development of neuropathies . One mechanism to replace neurons in the CNS is through the activation of stem cells and neuronal progenitor cells . We have tested the effects of the novel P0C6A0 mimetics exenatide ( exendin - 4 ; 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01276
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) and liraglutide ( DB06655 ; DB06655 ) , which are already on the market as treatments for type 2 diabetes , on the proliferation rate of progenitor cells and differentiation into neurons in the dentate gyrus of brains of mouse models of diabetes . P0C6A0 analogues were injected subcutaneously for 4 , 6 , or 10 weeks once daily in three mouse models of diabetes : ob / ob mice , db / db mice , or high-fat-diet-fed mice . Twenty-four hours before perfusion , animals were injected with 5 ' - bromo - 2 ' - deoxyuridine ( BrdU ) to mark dividing progenitor cells . By using immunohistochemistry and stereological methods , the number of progenitor cells or doublecortin-positive young neurons in the dentate gyrus was estimated . We found that , in all three mouse models , progenitor cell division was enhanced compared with nondiabetic controls after chronic i . p . injection of either liraglutide or exendin - 4 by 100-150 % ( P &lt; 0.001 ) . We also found an increase in young neurons in the DG of high-fat-diet-fed mice after drug treatment ( P &lt; 0.001 ) . The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P43220
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonist exendin ( 9-36 ) reduced progenitor cell proliferation in these mice . The results demonstrate that P0C6A0 mimetics show promise as a treatment for neurodegenerative diseases such as Alzheimer ' s disease , because these novel drugs cross the blood-brain barrier and increase neuroneogenesis .</div>
